SELECT
    u.id AS user_id,
    m.merchant_name,
    m.document_number,
    u.email,
    u.phone_number,
    u.role,
    d.provider_status,
    to_char(d.updated_at, 'DD/MM/YYYY HH24:MI:SS') AS updated_at,
    to_char(d.in_transit_to_deliver_at, 'DD/MM/YYYY HH24:MI:SS') AS in_transit_to_deliver_at,
    to_char(d.delivery_estimate_date, 'DD/MM/YYYY') AS delivery_estimate_date,
    d.invoice_id, 
    d.serial_number,
    da.cep, 
    da.street, 
    da.number, 
    da.complement, 
    da.neighborhood, 
    da.city, 
    da.state,
    to_char(d.created_at, 'DD/MM/YYYY HH24:MI:SS') AS created_at,
    to_char(d.in_transit_to_local_distribution_at, 'DD/MM/YYYY HH24:MI:SS') AS in_transit_to_local_distribution_at,
    to_char(d.local_distribution_at, 'DD/MM/YYYY HH24:MI:SS') AS local_distribution_at
    
FROM device_orders AS d
INNER JOIN merchants AS m ON m.user_id = d.merchant_id
INNER JOIN users AS u on u.id = d.merchant_id
INNER JOIN invoices AS i ON i.id = d.invoice_id
INNER JOIN sales_orders AS s ON s.id = i.logistic_order_id
INNER JOIN delivery_addresses AS da ON da.id = s.delivery_address_id

WHERE d.status = 'address_error'
